import "../Styles/styles.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { useState } from "react";
import emailjs from "emailjs-com";
import dotenv from 'dotenv';
dotenv.config();
import './env'



export const DiscountForm = () => {
  let [firstName, setFirstName] = useState("");
  let [lastName, setLastName] = useState("");
  let [email, setEmail] = useState("");
  let [code, setCode] = useState("LOYALTY15OFF");
  let [to_Name, setTo_Name] = useState("myredlandsfarm@gmail.com");

  let REACT_APP_SERVICEID = process.env.SERVICE_ID;
  let REACT_APP_PUBLICKEY = process.env.PUBLIC_KEY;
  let REACT_APP_TEMPLATEID = process.env.TEMPLATE_ID;
  /* eslint-disable */console.log(...oo_oo(`628868177_21_2_21_34_4`,REACT_APP_SERVICEID))

  let handleSubmit = (e) => {
    e.preventDefault();
    let params = {
      to_Name: to_Name,
      firstName: firstName,
      lastName: lastName,
      email: email,
    };
    emailjs
      .send(
        REACT_APP_SERVICEID,
        REACT_APP_TEMPLATEID,
        params,
        REACT_APP_PUBLICKEY
      )
      .then((res) => {
        /* eslint-disable */console.log(...oo_oo(`628868177_39_8_39_24_4`,res));
      })
      .catch((error) => {
        /* eslint-disable */console.log(...oo_oo(`628868177_42_8_42_26_4`,error));
      });
    let getClass = document.getElementById("code");
    getClass.className = "discountcodeshow";
    return code;
  };

  return (
    <>
      <div className="container-fluid">
        <form onSubmit={handleSubmit} className="form-horizontal">
          <div className="label">
            <label htmlFor="firstName">*First Name:</label>
          </div>
          <div className="input">
            <input
              type="text"
              id="first name"
              onChange={(e) => setFirstName(e.target.value)}
              required
            />
          </div>

          <div className="label">
            <label htmlFor="lastName">*Last Name:</label>
          </div>
          <div className="input">
            <input
              type="text"
              id="lastName"
              onChange={(e) => setLastName(e.target.value)}
              required
            />
          </div>

          <div className="label">
            <label htmlFor="email">*Email:</label>
          </div>
          <div className="input">
            <input
              type="email"
              id="email"
              onChange={(e) => setEmail(e.target.value)}
              required
            />
          </div>

          <div>
            <input type="submit" className="submit" value="Submit" />
          </div>
          <div className="discountcode" id="code">
            <h1 className="code" id="code">
              <a
                href="https://myredlandsfarm.etsy.com?coupon=LOYALTY15OFF"
                target="_blank"
                rel="noreferrer"
              >

                {code}
              </a>

            </h1>
          </div>
        </form>
      </div>
    </>
  );
};
